`,l.jsx(t.h3,{id:"primary-audiences",children:"Primary Audiences"}),`
`,l.jsxs(t.ul,{children:[`
`,l.jsxs(t.li,{children:[l.jsx(t.strong,{children:"Designers"}),": Reusable, branded, accessible UI components for consistency and visual fidelity."]}),`
`,l.jsxs(t.li,{children:[l.jsx(t.strong,{children:"Frontend Developers"}),": Type-safe, customizable components with baked-in accessibility and documentation."]}),`
`]}),`
`,l.jsx(t.h3,{id:"secondary-audiences",children:"Secondary Audiences"}),`
`,l.jsxs(t.ul,{children:[`
`,l.jsxs(t.li,{children:[l.jsx(t.strong,{children:"Content Creators"}),": Clear content containers and flexible layouts."]}),`
`,l.jsxs(t.li,{children:[l.jsx(t.strong,{children:"Product Managers"}),": System-level consistency and scalability."]}),`
`,l.jsxs(t.li,{children:[l.jsx(t.strong,{children:"Marketing Teams"}),": Themeable, brand-aligned UI components."]}),`
`]}),`
`,l.jsx(t.hr,{}),`
