`,l.jsxs(t.ol,{children:[`
`,l.jsxs(t.li,{children:[l.jsx(t.strong,{children:"Expressive"})," – Bold, warm, musical tone in visuals and interactions."]}),`
`,l.jsxs(t.li,{children:[l.jsx(t.strong,{children:"Authentic"})," – Rooted in Fender’s brand legacy; handcrafted feel."]}),`
`,l.jsxs(t.li,{children:[l.jsx(t.strong,{children:"Inclusive"})," – Accessible to all, diverse representation."]}),`
`,l.jsxs(t.li,{children:[l.jsx(t.strong,{children:"Clarity"})," – Prioritizes navigation and content readability."]}),`
`,l.jsxs(t.li,{children:[l.jsx(t.strong,{children:"Empowering"})," – Supports confident learning and user control."]}),`
`]}),`
